import React from 'react'
import { nikeAir } from "../data";

function Home() {
    return (
        <div className="container">
            <h1>Welcome to this sneaker blog</h1>
            <div className="gallery">

                {nikeAir.map((item, i) => {
                    return (
                        <img src={item.image} className="gallery-item" alt='hi'></img>
                    )
                })}
            </div>
        </div>
    )
}

export default Home
